text:
Schau't an wie manche Noth das Schwerdt auff mich gewetzet:
                                    Die Eltern rühr' ich nicht / die ich schon da verlohr;
                                    Als Alexander mich zu seiner Schnur erkohr.

Mein Blut ist nicht vergossen;
                                    Doch bin ich mehr denn Tod / die Erde deckt mich nicht;
                                    Doch schleust deß Kerckers Nacht mein trübes Angesicht.

Der Purpur riß entzwey / der Zepter brach als Glaß /
                                    Ich glaubte daß ich selbst auff scharffen Dornen saß /
                                    Vil suchten mir vmbsonst mitleidend beyzuspringen;
                                    Noch mehr hergegen mich in höchste Qual zu bringen;
                                    Biß mich ein frembder Mann nicht ohne Pein anliff
                                    Vnd als mit einem Sturm vmb beyde Brüst' ergriff.

Als Meurab vnser Ach vnd heisses Leid erblicket;
                                    Wurd endlich auff sein Wort der eine Fürst beschicket /
                                    Der vns das blosse Schwerdt an Hertz vnd Halse setzt.

Den Greuel damit er sein Weib vnd Kind betrübt;
                                    Als er ins Vatern Aug' unmenschlich hat verübt
                                    Was man nicht nennen darff.

Sein Zorn ist gegen vns bißher nicht außgebrochen /
Wie hoch auch der Verlust der Völcker jhn bewegt;
Weil Meurab jhm mehr Werck zu spinnen angelegt.

Doch es ist eben diß Princessin was vns bindet;
                                    Ein Schatz zu welchem man ohn' Arbeit zugang findet
                                    Kan nicht so trefflich seyn!

Es sind weit schärffer Klauen /
                                    Die vns durch dise Brust biß in das Hertz gehauen /
                                    Es ist ein ander Feind der dise Seele plagt;
                                    Der disen Leib zerfleischt vnd an den Glidern nagt;

Doch eh ich gantz zurück / O Ruhm der Helden / kehre;
                                    Ist Noth daß ich zuletzt höchst bittend was begehre /
                                    Doch mehr mein Czar durch mich / er der so viel nachgibt;
                                    Der mehr gemeine Ruh als grossen Vortheil libt;
                                    Helt an / vmb eine Fraw / der Bande zu entschlagen /
                                    Die in Iberien vor dem die Cron getragen /
                                    Vnd nun gefangen traur't.

Da Czar auch anzusprechen
                                    Durchlauchtigster Monarch vmb etwas das jhr sucht;
                                    Versichert euch diß fest / ihr sucht nicht sonder frucht.

Was vnserm Bruder Czar ohn alles Falsch versprochen;
Sind wir für vnser Theil steiff / fest vnd vnverbrochen /
Zu halten stets gemeint.

Die jtzt vor Ubermuth wer Chach vnd sie vergessen;
                                    Wird wenn sie nur von hir jhr Vnglück recht ermessen;
                                    Vnd fühlen das sie hir im Kercker mehr denn frey /
                                    Doch dort in Gurgistan / mehr als gekerckert sey!

Chach wird sich zweyfels ohn nicht sonder Schmertzen finden;
                                    Doch wissen wir daß Chach sich selbst könn' überwinden /
                                    Den Niemand überwand!

Glaubt Herr das heist auffs new' auff ewig vns verbinden


Glaubt Herr / dem so vil Müh für vnser Heil behagt;
                                    Wir bleiben euch verpflicht / vnd eures Czaren Magd.

Doch weil euch nicht erschreckt / was sonder furchtsam grauen
                                    Auch ein verstockter Türck ohnmächtig anzuschauen;
                                    Find't eur verlangen stat.

Er fing kaum an zu blühen;
                                    Als er auff Abas Wort auch must in Persen zihen /
                                    Vnd für vns Geissel seyn.

Geht hin / rief Tamaras / sagt eurem König an;


Daß wo er Abas Hand vns heut auffweisen kan /
                                    Wir willigst abzustehn.

Biß daß durch Bottschafft jhm / der Türcken Fürst anbracht;
                                    Daß er zu seinem Zug auch Gurgistanscher Macht
                                    Zu brauchen sich erklärt.

Die Funfftzig welch' er nun von sich nach Hause liß;
                                    Die warens die sein Volck auff erstem Weg' erstiß /
                                    Auff sein selbst eigen Wort.

Kanst Abas nicht verdencken /
                                    Daß er / der dich bißher gelibt ohn alle Frucht;
                                    Mit Ernst sein eigen Heil in deiner Wolfart sucht.

Süsses Land das wir gegrüsset
Als der Tag vns angelacht;
Das mit vns die Freyheit misset /
Vnd in Persens Banden schmacht;
Laß nu ab von langem Klagen
Vnd verkehr' in Lust dein Zagen.

                                    Nymphen die ihr vmb die Wipffel
                                    Der besteinten Felsen springt;
                                    Die jhr vmb die grünen Gipffel


Der bejahrten Palmen singt;
                                    Last euch weit vnd breit zu Ehren
                                    Eurer Catharinen hören.

Singt daß sie das rauhe Toben
Deß erhitzten Grimms verlacht;
Daß sie das geschmünckte loben
Der verlibten Lust veracht;
Daß sie / ob sie gleich gebunden /
Reich / vnd sich / in sich gefunden.

Der Cörper ist in Banden;
                                    Doch find der Geist sich frey / der durch vil Creutz bewehrt
                                    Doch / weil du für vns wachst / durch keine Glut verzehrt!

Sol denn die Kett' auffspringen;
                                    Wilst du vns wieder heim nach schwerem Elend bringen;
                                    So gib daß vnser Schiff das auff den Wellen stund
                                    Nicht geh' auff stiller See vnd in dem Port zu Grund.

Da wir nun JEsu trew / vnd bleiben Abas Magd;
                                    So wird vns ja von Chach nicht Brodt nicht Tuch versagt
                                    Das jeder Sclav' empfing.

Vnd zittert für der rauhen Noht;
                                    Der frische Geist rufft nach dem Tod
                                    Behertzt der ängsten Angst zu tragen!

Itzt wird der Traum erfüllet
                                    Der / als vergangne Nacht vns Sorg vnd Schlaff vmbhüllet;
                                    Auff disen Außgang wiß.

Der endlich an vns setzte
                                    Vnd auß den Dornen riß / vnd (wie es schin) verletzte;
                                    Ist (Zweifels ohn) der Tod.

Wofern der Höchst euch noch wird in Gurgistan holen;
                                    So zeigt dem Tamaras vnd allem Land-Volck an;
                                    Der möge nicht vergehn der wie wir sterben kan.

Bißher hab ich mein Land vnd Eltern nur beklagt;
Sie war stat beyder mir / sie die von Trost vns sagt /
Wenn schir das Hertze brach.

Wenn man dem zarten Fleisch zusetzet /
                                    Vnd Schwerdter auff die Hälse wetzet;
                                    Wie daß jhr so verzagt ob dem was tödten kan!

helt leider mich vnd dich
                                    Zu grösserm Vnheil auff / dem mehr bestimt zu leiden;
                                    Den läst entsetzen nicht in leichter Ohnmacht scheiden.

Doch sie / in dem man zwickte
                                    Vnd von der Armen Röhr die flachen Mausen rückte
                                    Rief;

Ein seel'ger Himmels-Erb
                                    Schläft sanfft / so in der See / als in den tif'sten Gründen;
                                    Vor denen / die in Gold vnd Marmorstein sich finden.

Wo Chach das Recht lest schlaffen;
                                    Vnd nicht diß Mordstück eilt nach würden abzustraffen;
                                    So schreit die Wolcken an / so reist den Bund entzwey /
                                    Vnd ziht die Sebel aus.

Auch / daß er ja was wir gesonnen / könne spüren;
                                    Läst jhn Chach Abas die mit sich auß Persen führen
                                    So noch von Gurgistan vnd Tefflis vbrig sind.
